@Executive_Training_Group doing a good job at getting hits and not outrunning the headlights. Its one thing to move fast in broad daylight. Its another thing to work with strange shadows and weapon mounted lights. When you turn on a cone of light, you can collect a lot of info in some areas, but quickly turn your eyes to tunnel vision. Turning that light off may allow your eyes to escape tunnel vision, but now your eyes have adjusted to the light. So, for how much is going on, Garret is actually moving pretty quick. ⁠
